-- 테이블 homepage2025_db.board 구조 내보내기
CREATE TABLE IF NOT EXISTS `board` (
  `BOARD_ID` char(20) NOT NULL COMMENT '게시판ID',
  `BOARD_TYPE` varchar(10) DEFAULT NULL COMMENT '게시물타입',
  `BOARD_SJ` varchar(2000) DEFAULT NULL COMMENT '게시물제목',
